CREATE DEFINER=`root`@`localhost` PROCEDURE `search_for_bar_entrees`(input varchar(44))
BEGIN
declare description varchar(45);
set description := concat(input, "%");
Select Distinct barentree_name, barentree_descript, barentree_price
From (barentree as ke
  Inner join barrecipe as br on br.barentree_id = br.barentree_id)
  Inner join ingredient as i on i.ingredient_id = br.ingredient_id
Where barentree_name Like description
  Or barentree_descript Like description
  Or ingredient_name Like description
  Or ingredient_descript Like description
Order by barentree_name;
END ;;
